import React, { useEffect, useState } from 'react';  
import { useParams } from 'react-router-dom';
import { fetchDesciplinesData } from '../api/countryAPI'; 
import { Container } from 'react-bootstrap'; 
import { NavBar } from '../components/NavBar';
import '../styles/css.css';
import DisciplineDetails from '../components/DisciplineDetails';

const DisciplineCountry = ({ disciplineName, countryName, disciplineData }) => {

    return (
        <Container className="containerStyle">
            <NavBar/>
            <DisciplineDetails
                disciplineName={disciplineName} 
                countryName={countryName} 
                disciplineData={disciplineData.discipline} />
        </Container>
    );
};

export default DisciplineCountry;
